    to review of the October Monthly Report (9/1/07-9/30/07).  No payments for salaries
    were required to be paid entirely with federal funds since no individual employee
    has spent in excess of 25% of their time on activities connected to a federal
    election or on activities defined as Federal Election Activity.  All salaries
    for administrative staff or employees who spend less than 25% of their time in
    connection with a federal election are appropriately paid with a percentage of
    federal and nonfederal funds and are disclosed on Schedule H-4 in support of Line
    21(a).  2 Due to clerical mistake serveral of the void checks reported on Line
    30b were corrected and the report is being amended to update the original date
    of issue  to 2006 instead of 2007.  Please note that some of the voided disbursements
